COPY ftlc.category (id, name, description) FROM stdin;
9a538941-e738-450a-8b2b-87061bbee453	Labs	Our labs provide flexibility for each student to explore programming at a personalized pace suitable to him/her. Our coding labs are ongoing and meet year-round, so students can enroll at any time. Students are encouraged to explore technologies that interest them and work at a pace best-suited to their learning style. Our labs meet weekly for an hour each week. Students work on individual projects with assistance from an instructor. The student-to-instructor ratio is 3:1. New students can sign up for a one-hour free trial by calling us at 512-900-8380.
74bc0de1-7cae-43c9-9c85-3a9780801143	Classes	Our group classes are instructor-led and cover a specific program or platform for a certain number of weeks. Classes include Introduction to Coding, Minecraft Mods in Java, Video Game Development, Scratch Programming, Python, Virtual Reality and others. Classes are held at our studio in Round Rock, unless otherwise indicated. If you don’t see a class that fits your family’s schedule, please let us know, as we often add classes based on feedback from parents.
5c461724-7af7-4053-babf-ce0b09ea1b65	Workshops	 this is a workshop
7ce8df3c-f1c6-453f-9293-d17ea64f60f3	Summer Camps	Our day camnpps are for children and teens ages 7-16 years old and are held from 9:00 am to 4:00 pm. Our next day camps will be offered on Monday, October 8 and Tuesday, October 9.
\.
COPY ftlc.activity (id, category, url, name, description, public_display, archive) FROM stdin;
9529065a-1285-49ea-8b3f-4eb01e9b0c57	7ce8df3c-f1c6-453f-9293-d17ea64f60f3	https://scratch.mit.edu/images/scratch-og.png	Scratch Intermediate	Scratch intermediate is our second level scratch class for those who have some experience in scratch. Instead of learning the basics, students will use scratch to create more complex projects involving multi-level, two player and even physics based games. Designed for ages 8 to 13.	t	t
d727a65f-08ea-448a-8239-66d83af13131	7ce8df3c-f1c6-453f-9293-d17ea64f60f3	https://scratch.mit.edu/images/scratch-og.png	Scratch Beginner	Scratch beginner is an introductory class for those who have little to no experience coding. As the name suggests, the class is based around the programming language scratch, a fun and simple way to approach the topics of programming. Through the course of this camp students will learn how to use the main scratch coding blocks to create various projects and games. Designed for ages 7 to 11.	t	t
93984399-2d0c-4915-9c25-600e629221a9	9a538941-e738-450a-8b2b-87061bbee453	https://s3.amazonaws.com/cdn-origin-etr.akc.org/wp-content/uploads/2017/11/12231410/Labrador-Retriever-On-White-01.jpg	Open Labs (Moday)	In our open labs students work under the guidance of our instructors on a topic that interests them. Topics we provided projects for include scratch, kodu, unity, and python, though we are able to teach a wide range.	t	t
1c079633-c688-413c-bac9-9fce3f637883	9a538941-e738-450a-8b2b-87061bbee453	https://s3.amazonaws.com/cdn-origin-etr.akc.org/wp-content/uploads/2017/11/12231410/Labrador-Retriever-On-White-01.jpg	Open Labs (Sunday)	In our open labs students work under the guidance of our instructors on a topic that interests them. Topics we provided projects for include scratch, kodu, unity, and python, though we are able to teach a wide range.	t	t
